import React from "react";
import Header from "./Header.js";
import Slider from "react-slick";

const imgdata = [
    {img:"https://i.imgur.com/Am5zBQb.png"},
    {img:"https://i.imgur.com/m5Qf2U3.png"}
]
function Homepage() {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      };
    return(
        <div>
            <Header/>  
            <Slider {...settings}>
                {imgdata.map((img, index) => (
                    <div index>
                        <img></img>
                    </div>
                ))}
            </Slider>
        </div>
    )
}
export default Homepage
